		(yy_buffer_stack) = (struct yy_buffer_state**)ptxinfo_realloc
								((yy_buffer_stack),
								num_to_alloc * sizeof(struct yy_buffer_state*)
								);
		if ( ! (yy_buffer_stack) )
			YY_FATAL_ERROR( "out of dynamic memory in ptxinfo_ensure_buffer_stack()" );

